    return (
      <View style={{padding:20}}>
    <Text style={styles.zap}>{props.zap}</Text>
    <Text style={styles.zap}> DIGITA LAGO </Text>
      </View>
    );
  }
  const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
    
